pragma solidity 0.8.10;

/// @title Midas 
/// @author midaswap
/// @notice Helper contract used for fees calculation
library FeeHelper {

    function getFeeAmountFrom(uint128 _fee, uint128 _amountWithFees) internal pure returns (uint128) {
        unchecked{
            return uint128((uint256(_amountWithFees) * _fee + 1e18 - 1) / 1e18);
        }
    }


    function getFeeAmount(uint128 _fee, uint128 _amount) internal pure returns (uint128) {
        unchecked{
            uint256 _denominator = 1e18 + _fee;
            return uint128((uint256(_amount) * _fee + _denominator - 1) / _denominator);
        }
    }

    // Assuming protocol share  = 10%
    function getFeeAmountDistributionWithRoyalty(uint128 _feeBase, uint128 _rateFee , uint128 _rateRoyalty)
        internal
        pure
        returns (uint128 _feesTotal , uint128 _feesProtocol , uint128 _feesRoyalty)
    {
        unchecked {
            _feesTotal = _feeBase * _rateFee / 1e18 ;
            _feesProtocol = _feesTotal / 10 ;
            _feesRoyalty = _feeBase * _rateRoyalty / 1e18 ;
        }
    }




}

